import React, { useState } from 'react'
import { Image, Row } from "react-bootstrap";
import { NavLink } from "react-router-dom";
import { FAVORITE_ROUTE, BASKET_ROUTE, LOGIN_ROUTE, SHOPE_ISKUS_YELKI_ROUTE, SHOP_ROUTE, SEARCH_ROUTE } from "../utils/consts";
import { observer } from "mobx-react-lite";
export const UpNavbarMobile = observer(() => {
    const [openBurger, setOpenBurger] = useState(false)
    const burger = () => {
        if (openBurger === true) {
            setOpenBurger(false)
        } else {
            setOpenBurger(true)
        }
    }
    return (
        <div className="up-nav-m">
            <div className="up-nav-m-content">
                <div onClick={() => burger()} className={openBurger ? "burger active" : 'burger'}>
                    <span className={openBurger ? 'span-bureg activ' : 'span-bureg'}></span>
                </div>
            </div>
            <div className={openBurger ? 'links-block-burer' : 'links-block-burer active'}>
                <ul>
                    <li><NavLink to={LOGIN_ROUTE}><p>О компании</p></NavLink></li>
                    <li><NavLink to={SHOP_ROUTE}><p>Доставка и оплата</p></NavLink></li>
                    <li><NavLink to={SHOP_ROUTE}><p>Контакты</p></NavLink></li>
                </ul>
            </div>
        </div>
    )
});
